    calcData(type = 'level1', centerName = '') {
      // // let symbol = this.useImage(imageLocal)
      // let symbol = 'image://' + this.base64Image
      this.viewType = type
      let baseData = this.baseData()
      let initialData = []
      let initialLinks = []
      if (type == 'level1') {
        baseData.forEach((item) => {
          let tmp = {
            id: item.id + '',
            name: item.name,
            parent: item?.parent || '',
            symbolSize: 30,
            itemStyle: { color: '#fac858' },
            level: item.level
          }
          if (item.level == 2) {
            initialData.push(tmp)
          }
          if (item.level == 1) {
            // tmp.symbol = symbol
            tmp.symbolSize = 40
            tmp.itemStyle = { color: '#5470c6' }
            initialData.push(tmp)
          }
          if (item.level == 3) {
            let tmpIndex = initialData.findIndex(
              (el) => el.parent == item.parent
            )
            if (tmpIndex == -1) {
              tmp.name = 1
              tmp.symbolSize = 25
              tmp.itemStyle = { color: '#91cc75' }
              initialData.push(tmp)
            } else {
              initialData[tmpIndex].name += 1
            }
          }
        })
        initialData.forEach((item) => {
          if (item.level != 1) {
            let tmp = {
              source: item.parent + '',
              target: item.id + ''
            }
            initialLinks.push(tmp)
          }
        })
      } else {
        let centerObj = baseData.find((el) => el.name == centerName)
        baseData.forEach((item) => {
          if (
            item.level == 1 ||
            centerObj.id == item.id ||
            centerObj.id == item.parent
          ) {
            let tmp = {
              id: item.id + '',
              name: item.name,
              parent: item?.parent || '',
              symbolSize: 30,
              itemStyle: { color: '#fac858' },
              level: item.level
            }
            if (item.level == 1) {
              tmp.symbol = pic
              tmp.symbolSize = 40
              tmp.itemStyle = { color: '#5470c6' }
            }
            if (item.level == 3) {
              tmp.symbolSize = 25
              tmp.itemStyle = { color: '#91cc75' }
            }

            initialData.push(tmp)
            let tmp1 = {
              source: centerObj.id + '',
              target: item.id + ''
            }
            initialLinks.push(tmp1)
          }
        })
      }
      console.log('initialData, initialLinks: ', initialData, initialLinks)
      return {
        initialData,
        initialLinks
