          myChart.setOption(option, true)
        }
        if (params.dataType === 'node' && params.data.level == 1) {
          if (_this.viewType == 'level1') return
          const { initialData, initialLinks } = _this.calcData('level1')
          option.series[0].data = initialData
          option.series[0].links = initialLinks
          // 更新图表
          option.series[0].force.initLayout = null
          myChart.setOption(option, true)
        }
      })
    },
    async calcTest2() {
      const convertButton = document.getElementById('convertButton')
      const originalImage = document.getElementById('originalImage')
      const base64Image = document.getElementById('base64Image')

      convertButton.addEventListener('click', async () => {
        try {
          const img = new Image()
          img.crossOrigin = 'anonymous' // 设置跨域属性
          img.src = originalImage.src

          await new Promise((resolve, reject) => {
            img.onload = resolve
            img.onerror = reject
          })

          const canvas = document.createElement('canvas')
          canvas.width = img.width
          canvas.height = img.height

          const ctx = canvas.getContext('2d')
          ctx.drawImage(img, 0, 0)

          const base64 = canvas.toDataURL()
          base64Image.src = base64
          console.log(base64)
        } catch (error) {
          console.error('Error converting image to base64:', error)
        }
      })

      const imageInput = document.getElementById('imageInput')
      const resultDiv = document.getElementById('result')

      imageInput.addEventListener('change', function (event) {
        const file = event.target.files[0]
        if (file) {
          const reader = new FileReader()
          reader.onload = function (e) {
            const imageDataUrl = e.target.result
            const width = 200
            const height = 200

            // 创建 SVG 字符串
            let svg = `
                        <svg width="${width}" height="${height}">
                            <clipPath id="circleClip">
                                <circle cx="${width / 2}" cy="${
              height / 2
            }" r="${Math.min(width, height) / 2}" />
                            </clipPath>
                            <image href="${imageDataUrl}" xlink:href="${imageDataUrl}" width="${width}" height="${height}" clip-path="url(#circleClip)" />
                        </svg>
                    `
            // 处理 SVG 字符串中的特殊字符
            svg = svg.replace(/[\t\n\r]/g, ' ')
            svg = svg.replace(/"/g, "'")

            try {
              // 将 SVG 字符串转换为 Base64
              const svgBase64 =
                'data:image/svg+xml;base64,' +
                btoa(unescape(encodeURIComponent(svg)))

              console.log(svgBase64)

              // 显示裁剪后的图片
              const img = document.createElement('img')
              img.src = svgBase64
              resultDiv.appendChild(img)
            } catch (error) {
              console.error('Base64 encoding error:', error)
            }
          }
          reader.onerror = function (error) {
            console.error('File reading error:', error)
          }
          reader.readAsDataURL(file)
        }
      })
    },
